package jadx.tests.integration.loops;

import java.util.HashMap;
import java.util.Map;

public class TestTryCatchInLoop2$TestCls<T extends String> {
    private final Map<Integer, MyItem> mCache = new HashMap();

    private static class MyItem {
        int idx;
        String name;

        private MyItem() {
        }
    }

    void test(MyItem[] items) {
        synchronized (this.mCache) {
            for (int i = 0; i < items.length; i++) {
                MyItem existingItem = (MyItem) this.mCache.get(Integer.valueOf(items[i].idx));
                if (existingItem == null) {
                    this.mCache.put(Integer.valueOf(items[i].idx), items[i]);
                } else {
                    existingItem.name = items[i].name;
                }
            }
        }
    }
}
